import React from 'react'

 function listItem({message , name, date}) {
    return (
      <div className="d-flex row pb-2em">
         <div className="bg-footer-dark bold col d-flex justify-space p-1_5em w-30">
            <label >{name}</label>
         </div>
         <div className="bg-footer-dark col d-flex justify-space justify-around ml-auto">
            <label>{date}</label>
         </div>
      </div>
    )
}
export default listItem;
